import React, { Component } from "react";
import ReservationList from "./ReservaionList";
import './reserveListTotal.css';

const list = {
    'date':'07.04. 13:00',
    'shop':'봉봉살롱',
    'address':'부산광역시',
    'telephone':'010-0000-0000'
}

function ReserveListTotal() {
    return (
      <div className="main_T">
        <p>예약내역</p> 
        <div className="rowline"></div>  
        <div className="col_">
            <p>예약일자</p>
            <p>매장명</p>
            <p>매장 주소</p>
            <p>매장 연락처</p>
            <p>상세보기</p>
        </div>  
        <ReservationList
        date ={list.date}
        shop = {list.shop}
        address = {list.address}
        telephone = {list.telephone}
        />
        <ReservationList
        date ={list.date}
        shop = {list.shop}
        address = {list.address}
        telephone = {list.telephone}
        />
        <ReservationList
        date ={list.date}
        shop = {list.shop}
        address = {list.address}
        telephone = {list.telephone}
        />
        <ReservationList
        date ={list.date}
        shop = {list.shop}
        address = {list.address}
        telephone = {list.telephone}
        />
        <ReservationList
        date ={list.date}
        shop = {list.shop}
        address = {list.address}
        telephone = {list.telephone}
        />
      </div>
    );
   }
  
  export default ReserveListTotal;
